import React, { useRef } from "react";
import "./style/Shopping.css";
const Shopping = () => {
  let Cart = useRef();
  let SideBar = useRef();
  return (
    <div className="main">
      <div ref={SideBar} className="sideBar"></div>
      <div className="shopping">
        <button></button>
        <button></button>
      </div>
      <div className="cart"></div>
    </div>
  );
};

export default Shopping;
